import React from 'react'
import SideDesign from './SideDesign'
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Button from 'react-bootstrap/Button';
import { useState } from 'react';
import axiosInstance from '../axios';


export default function StudentRegister() {

  const initialFormData=Object.freeze({
    user_type: 'student'
  })

  const [formData, setFormData] = useState(initialFormData)


  function handleInputChange(e){
    
    setFormData({
      ...formData,
      [e.target.name]: e.target.value.trim()
    })
  }

  function handleSubmit(e){
    e.preventDefault()
    
    axiosInstance.post('users/create', formData)
    .then((res)=>{
      console.log(res.data)
    })
    .catch((err)=>{
      console.error(err)
    })
  }


  return (
    <>
    <SideDesign/>
    

    <div style={{marginLeft: '23cm', marginTop: '-7cm'}}>
     <center>
      <h3>Student Registration</h3><br/>
      
      <Form onSubmit={(e)=>handleSubmit(e)}>

      <InputGroup className="mb-1 bars"  style={{width: '9cm', paddingBottom: '0.3cm'}}>
        
        <Form.Control
          placeholder="First Name"
          name="firstname"
          aria-describedby="basic-addon1"
          required
          onChange={(e)=>handleInputChange(e)}
         
          
        />
        
      </InputGroup>

      <InputGroup className="mb-1 bars"  style={{width: '9cm', paddingBottom: '0.3cm'}}>
        
        <Form.Control
          placeholder="Last Name"
          name="lastname"
          aria-describedby="basic-addon1"
          required
          onChange={(e)=>handleInputChange(e)}
          
        />
        
      </InputGroup>

      <InputGroup className="mb-1 bars"  style={{width: '9cm', paddingBottom: '0.3cm'}}>
        
        <Form.Control
          placeholder="Roll Number"
          name="rollnum"
          aria-describedby="basic-addon1"
          required
          onChange={(e)=>handleInputChange(e)}
          
        />
        
      </InputGroup>
      
      <InputGroup className="mb-1 bars"  style={{width: '9cm', paddingBottom: '0.3cm'}}>
        
        <Form.Control
          placeholder="Email"
          name="email"
          aria-describedby="basic-addon1"
          required
          onChange={(e)=>handleInputChange(e)}
          
        />
        
      </InputGroup>

      <InputGroup className="mb-1 bars"  style={{width: '9cm', paddingBottom: '0.3cm'}}>
        
        <Form.Control
          placeholder="Password"
          name="password"
          aria-describedby="basic-addon1"
          required
          type='password'
          onChange={(e)=>handleInputChange(e)}
          
        />
        
      </InputGroup>
        

      <Button type="submit" variant="dark">Register</Button>
      
      </Form>
      </center>
     </div>
    </>
    
  )
}
